source.additionalInfo:
	Additional information: Author's note: This dataset is a slightly revised version of the one produced by Filipa Ribeiro da Silva for the CLIO Infra Project in December 2012. The most important differences can be summed up as follows: 
-  Whenever estimates by Maddison where available, his figures are being followed in favor of estimates by Gapminder; 
- For Africa, estimates by Frankema and Jerven (2014) for the period 1850-1960 have been added to the existing database; 
- For Latin America, estimates by Abad & Van Zanden (2014) for the period 1500-1940 have been added.
